import Phaser from 'phaser';

export default function TitleScreenText(){
    this.titleText = this.add.text(this.scale.width /2, this.scale.height /2, "TEST_PORT", {
        fontSize: '64px', fill: '#fff'    
    });

    this.titleText.setOrigin(0.5);
}
